import React, {Component} from 'react';
import PageMenu from "../../components/pageMenu/pageMenu";
import classes from "./CallBoard.css";
import BoardCard from "../../components/boardCard/BoardCard";

class CallBoard extends Component {

    state = {
        boardCard: [
            {image: 'Image', note: 'Lorem ipsum', persone: 'ME'}
        ]
    }

    render() {



        return (
            <div className={classes.callBoard}>
                <PageMenu/>
                <h1>Доска обьявлений</h1>
                <div className={classes.boardHolder}>
                    <BoardCard image={this.state.boardCard[0].image} note={this.state.boardCard[0].note} persone={this.state.boardCard[0].persone}/>
                </div>
            </div>
        );
    }
}

export default CallBoard;
